import React, { Component }  from 'react';
import { Table } from 'react';
import logo from './logo.svg';
import './App.css';


class App extends Component {
    constructor(props) {
      super(props);
      this.state = {
        team1Name: [],
        team1Score: [],
        team2Name: [],
        team2Score: []
      }
    }
    componentDidMount() {
      fetch('/nba',  {
        headers: {
          "Access-Control-Allow-Origin": "*"
        }
      })
        .then(response => {
          return response.json();
        })
        .then((data) => {
          for (let i = 0; i < data.length; i++) {
            this.setState({
              team1Name: data[i].team1Name,
              team1Score: data[i].team1Score,
              team2Name: data[i].team2Name,
              team2Score: data[i].team2Score,
            });
            console.log(data[i])
          }

        })
        .catch(error => console.log(error));
    }

    renderItems() {
      return this.state.team1Name.map(item => {
        <NewSingleItem key={item.team1Name} item={item.team1Name} />;
      });
    }

    render() {
        return (
          <li>
          {this.state.team1Name}
          </li>
        );
    }

  }
export default App;

